?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Это одна из немногих часовых компаний, которая завоевала всемирную популярность еще в 20-м веке. Первые часы, которые были произведены компанией Nivrel, были хронографы с ручным заводом. Причем, они были выпущены в ограниченном количества всего 100 экземпляров. Интересно, что все экземпляры были проданы буквально за неделю, и в данный момент являются бесценными для многочисленных коллекционеров, мечтающих получить хотя бы один экземпляр в свою коллекцию. Спустя 15 лет, компания выпускает точную копию часов Le Chronograph, которые функционировали при помощи механизма Non Landeron 48. Интересно, что в период с 1933 года по 1970-е, компания выпускала наручные часы, в которых механизм был точно такой же, как и в современное время (позолоченные и отполированные до блеска мосты, отделочные винты и так далее). Стоит отметить, что название, по большому счету, не принадлежит этой компании. Герд Хофер владелец компании, рассказывает, что для подборки названия он обратился в швейцарскую федерацию часовой индустрии. Эта федерация собирает все названия, которые исчезли с часового рынка. Все часы, произведенные компанией, имеют собственный оригинальный дизайн и, что немаловажно, многочисленные функции. Причем, как позиционирует себя Nivrel, они производят высококачественные часы по доступной цене. И это в действительности так.</span></span></p>
 
